template <>
int32_t GpuSqlDispatcher::groupByCol<std::string>()
{
    std::string columnName = arguments.read<std::string>();

    int32_t loadFlag = loadCol<std::string>(columnName);
    if (loadFlag)
    {
        return loadFlag;
    }

    std::cout << "GroupByString: " << columnName << std::endl;

    auto column = findStringColumn(columnName);

    int32_t reconstructOutSize;
    GPUMemory::GPUString reconstructOutReg;
    GPUReconstruct::ReconstructStringColKeep(&reconstructOutReg, &reconstructOutSize, std::get<0>(column),
                                             reinterpret_cast<int8_t*>(filter_), std::get<1>(column));
    if (filter_)
    {
        GPUMemory::free(std::get<0>(column));
    }

    std::get<0>(column) = reconstructOutReg;
    std::get<1>(column) = reconstructOutSize;

    if (std::find_if(groupByColumns.begin(), groupByColumns.end(), StringDataTypeComp(columnName)) ==
        groupByColumns.end())
    {
        groupByColumns.push_back({columnName, DataType::COLUMN_STRING});
    }

    return 0;
}

int32_t GpuSqlDispatcher::groupByDone()
{
    insideGroupBy = false;
    return 0;
}

int32_t GpuSqlDispatcher::groupByBegin()
{
    usingGroupBy = true;
    insideGroupBy = true;
    return 0;
}

int32_t GpuSqlDispatcher::aggregationDone()
{
    insideAggregation = false;
    return 0;
}

int32_t GpuSqlDispatcher::aggregationBegin()
{
    insideAggregation = true;
    return 0;
}
